import React from 'react';
import PropTypes from 'prop-types';
import './popup.scss';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCircleXmark } from '@fortawesome/free-solid-svg-icons';

import { Button } from '@mui/material';

const PopupHeader = () => {
    return(
        <div>
            <label for="trigger" className="close_btn">
                <FontAwesomeIcon icon={faCircleXmark} className="fa-sm fa-fw"/>
            </label>
        </div>
    )
}

const PopupBody = () => {
    return(
        <div>
            <div className="popup-body">
                <div>

                </div>
            </div>
        </div>
    )
}

const Popup = () => {
    return(
        <div>
            <label for="trigger" className="open_btn">Button for Popup</label>
            <div className="popup_wrap">
                <input id="trigger" type="checkbox"/>
                <div className="popup_overlay">
                    <label for="trigger" className="popup_trigger"></label>
                        <div className="popup_content">
                            <PopupHeader />
                            <p>ポップアップ</p>
                            <div>
                            <Button variant="text">キャンセル</Button>
                            <Button variant="outlined">OK</Button>
                            </div>
                        </div>
                </div>
            </div>
        </div>
    )
}

export default Popup;
